(def generation-config			     ; creates 
  (let [size-limit 120                   ; let used to spell out params ect.
        min-size 20
        ea-config (spea2/spea2-config
                    {:goals [:score]
                     :archive-size 50
                     :binary-ops [{:op cross-over :repeat 22}]
                     :unary-ops [{:op mutate :repeat 6}]})
        score-functions {:complexity (fn [ind] (count (:genotype ind)))
                         :error (fn [ind] (score ind))}]
    {:ea-config              ea-config
     :score-functions        score-functions
     :reporting-function     (fn [z] (print ".") (flush))}))
